import logo from './logo.svg';
import './App.css';
import Landing from './Pages/Landing';
import Home from './Pages/Home'

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// TODO: remove proxy from package.json
// Set the body background to black in the global styles or directly in the render method
document.body.className = "bg-black"; // or add margin/padding reset styles directly here

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Landing/>} />
        <Route path="/home" element={<Home/>} />
      </Routes>
    </Router>
  )
}

export default App;
